import React, { Component } from 'react';
import {withStyles} from '@material-ui/core'
class AddContact extends Component {
    state = {  }
    render() { 
        let classes=this.props.classes;
        return ( <div className={classes.mainContainer}>
                  <div className={classes.formContainer}>
                 <div className={classes.form}>
                   <div className={classes.content}>  
                      <label>Name</label>  
                      <input type="text" 
                      className={`form-control`} 
                      placeholder="Name" 
                      onChange={(e)=>{this.props.onChange&&this.props.onChange(e)}}/>
                   </div>
                   <div className={classes.content}>
                   <label>Last Name</label>
                   <input type="text" 
                   className={`form-control`} 
                   placeholder="Last Name" 
                   onChange={(e)=>{this.props.onChange&&this.props.onChange(e)}}/>
                   </div>
                   <div className={classes.content}>
                       <label>Email</label>
                   <input type="text" 
                   className={`form-control`} 
                   placeholder="Email" 
                   onChange={(e)=>{this.props.onChange&&this.props.onChange(e)}}/>
                   </div>
                   <div className={classes.content}>
                    <label>Phone</label>
                   <input type="text" 
                   className={`form-control`} 
                   placeholder="Phone" 
                   onChange={(e)=>{this.props.onChange&&this.props.onChange(e)}}/>
                   </div>
                   </div>
                  </div>
                </div> );
    }
}
const styles=theme=>({
    mainContainer:{
    position:"relative",
    borderWidth:"19px",
    content: " ",
    borderStyle:"solid",
    borderColor:'gray transparent transparent transparent',
    left:"33px",
    width:"20px"
    },
    formContainer:{

       position:"absolute",
       left:"-150px"
    },
    form:{
        paddingTop:"20px",
        width:"300px",
        height:"400px",
        background:"red",
        borderRadius:"30px",
    },
    content:{
     display:"flex",
     flexFlow:"column",
     padding:"0px 15px 15px 15px"
    },
})
export default withStyles(styles)(AddContact);
